"// Устанавливает значения индикаторов надежности. Вызвается после проверки авторизации СБИС в обработке оповещения.
//
// Параметры:
//  Результат  - Неопределено, Булево - авторизация прошла успешно или 
//                 не удалось проверить авторизацию
//  ДополнительныеПараметры  - Произвольный - дополнительные параметры, возвращаемые обработчиком оповещения.
//                 <продолжение описания параметра>
//
&НаКлиенте
Процедура УстановитьЗначенияИндикаторов(Результат, ДополнительныеПараметры) Экспорт

	Если Не Открыта() Тогда
		Возврат;
	КонецЕсли;

	Если saby_ВызовСервераПереопределяемый.ДоступныРолиСбис() Тогда
		saby_Клиент.УстановитьЗначенияИндикаторов(ЭтаФорма, Объект.Контрагент, Результат <> Неопределено И Результат, Ложь);
	КонецЕсли;

КонецПроцедуры // УстановитьЗначенияИндикаторов(Результат, ДополнительныеПараметры)

#Область ОбработчикиСобытийФормы

&НаСервере
Процедура saby_ПриСозданииНаСервереПосле(Отказ, СтандартнаяОбработка)

	Если Не saby_ВызовСервераПереопределяемый.ДоступныРолиСбис() Тогда 
		Возврат;
	КонецЕсли;

	ГруппаСБИС = Элементы.Вставить(""ГруппаСБИС"", Тип(""ГруппаФормы""), Элементы.ГруппаКонтрагент, Элементы.НадписьРеквизитыПолучателя);
	ГруппаСБИС.Вид = ВидГруппыФормы.ОбычнаяГруппа;
	ГруппаСБИС.РастягиватьПоВертикали		= Ложь;
	ГруппаСБИС.РастягиватьПоГоризонтали		= Ложь;
	ГруппаСБИС.РазрешитьИзменениеСостава	= Ложь;
	ГруппаСБИС.ТолькоПросмотр				= Ложь;
	ГруппаСБИС.ОтображениеПодсказки			= ОтображениеПодсказки.Нет;
	ГруппаСБИС.Группировка					= ГруппировкаПодчиненныхЭлементовФормы.ГоризонтальнаяВсегда;
	ГруппаСБИС.Отображение					= ОтображениеОбычнойГруппы.Нет;
	ГруппаСБИС.ОтображатьЗаголовок			= Ложь;
	Декорация = Элементы.Добавить(""ДекорацияСБИСЛевая"", Тип(""ДекорацияФормы""), ГруппаСБИС);
	Декорация.Вид							=ВидДекорацииФормы.Надпись;
	Декорация.Ширина						= 11;
	Декорация.Заголовок = ""Надёжность:"";

	saby_ВызовСервера.СоздатьЭлементыИндикатораНадежности(ЭтаФорма, ""ГруппаСБИС"", Истина, Ложь);

КонецПроцедуры

&НаКлиенте
Процедура saby_ПриОткрытииПосле(Отказ)

	Если saby_ВызовСервераПереопределяемый.ДоступныРолиСбис() Тогда 
		УстановитьЗначенияИндикаторов(Истина, Неопределено);
	КонецЕсли;

КонецПроцедуры

#КонецОбласти

#Область ОбработчикиСобыйтийЭлементовФормы

&НаКлиенте
Процедура saby_ДекорацияПоказатьНажатие(Элемент)

		saby_Клиент.ПроверитьАвторизоваться(Новый ОписаниеОповещения(""УстановитьЗначенияИндикаторов"", ЭтотОбъект));

КонецПроцедуры

&НаКлиенте
Процедура saby_ИндикаторСБИСНажатие(Элемент, СтандартнаяОбработка)

	saby_Клиент.ИндикаторСБИСНажатие(ЭтаФорма, Объект.Контрагент, Объект.ИННПолучателя, СтандартнаяОбработка);

КонецПроцедуры

#КонецОбласти

#Область ПереопределяемыЗаимствованияМетодовФормы

&НаКлиенте
Процедура saby_КонтрагентПриИзмененииПосле(Элемент)

	Если saby_ВызовСервераПереопределяемый.ДоступныРолиСбис() Тогда 
		УстановитьЗначенияИндикаторов(Истина, Неопределено);
	КонецЕсли;

КонецПроцедуры

